import './App.css';
import Post from './Post';

function App() {
  const [posts, setPosts] = useState([
    {
      username: "bk1234",
      caption: "it really works",
      imageUrl: "https://www.freecodecamp.org/news/content/images/size/w600/2020/02/Ekran-Resmi-2019-11-18-18.08.13.png"
    },
    {
      username: "bk1234",
      caption: "it really works",
      imageUrl: "https://www.freecodecamp.org/news/content/images/size/w600/2020/02/Ekran-Resmi-2019-11-18-18.08.13.png"
    }
  ]);

  return (
    <div className="app">
      <div className="app__header">
        <img
          className="app__headerImage"
          src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
          alt=""
        />
      </div>
      <h1>How to Build a Instagram Clone with REACT JS for Beginners (in 3 Hours!)</h1>
      <Post username="cleverqazi" caption="Wow it works" imageUrl="https://www.freecodecamp.org/news/content/images/size/w600/2020/02/Ekran-Resmi-2019-11-18-18.08.13.png"/>
